INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (2, 1, 1, "2023/09/22 14:59:59", 2002, 126501, 0.0, 10004, 1, "2023/06/30 12:00:00", "こちらのショップで\n買い物をして、素敵な\n旅を楽しんでくださいね", 0.0, -470.0, "ライラエル");
INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (1, 2, 2, "2023/12/22 14:59:59", 2002, 127702, 0.0, 10005, 2, "2023/09/15 15:00:00", "いらっしゃいませ\nキャラバンコインを使って\nお買い物ができますよ", 0.0, -470.0, "リンド");
INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (2, 2, 2, "2023/12/22 14:59:59", 2002, 127702, 0.0, 10006, 2, "2023/09/15 15:00:00", "ショップの掃除は完璧です\n姫さま直営のお店として\n当然のことですから", 0.0, -470.0, "リンド");
INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (1, 2, 1, "2023/12/22 14:59:59", 2002, 127802, 0.0, 10007, 1, "2023/09/15 15:00:00", "ショップへようこそ\nキャラバンコインと品物を\n交換できるんで、よければ", 0.0, -470.0, "ヴルム");
INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (2, 2, 1, "2023/12/22 14:59:59", 2002, 127802, 6.5, 10008, 2, "2023/09/15 15:00:00", "なんで店番なんか…\nま、やりますけど\n好きな品物をどうぞ", 0.0, -470.0, "ヴルム");
INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (1, 3, 1, "2024/03/22 14:59:59", 2002, 129602, 0.0, 10009, 2, "2023/12/15 15:00:00", "──いらっしゃいませ\n買い物しても、いいですよ\nキャラバンコインがあれば", 0.0, -470.0, "アネモネ");
INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (2, 3, 1, "2024/03/22 14:59:59", 2002, 129602, 0.0, 10010, 2, "2023/12/15 15:00:00", "──もっと笑顔がほしい？\nいくらコインを積まれても\n売れない物はありますから", 0.0, -470.0, "アネモネ");
INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (1, 3, 1, "2024/03/22 14:59:59", 2002, 129701, 0.0, 10011, 1, "2023/12/15 15:00:00", "ようこそおいでなんし\nキャラバンコインをこちら\nで交換して進ぜんしょう", 0.0, -470.0, "ネフィ=ネラ");
INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (2, 3, 1, "2024/03/22 14:59:59", 2002, 129701, 6.2, 10012, 2, "2023/12/15 15:00:00", "ところで、お前さまは\nいくらで贖えるのか喃？\n──フフ、冗談でありんす", 0.0, -470.0, "ネフィ=ネラ");
INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (1, 4, 5, "2024/06/22 14:59:59", 2002, 130301, 3.1, 10013, 3, "2024/03/15 15:00:00", "い、いらっしゃいませっ！\n…くっ…このあたくし様が\n店番なんて…屈辱ですわっ", 0.0, -470.0, "カノン");
INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (2, 4, 2, "2024/06/22 14:59:59", 2002, 130301, 6.15, 10014, 3, "2024/03/15 15:00:00", "あら、あたくしをご所望？\nお生憎様、そんな小銭では\n…買えちゃうんですの！？", 0.0, -470.0, "カノン");
INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (1, 4, 2, "2024/06/22 14:59:59", 2002, 130401, 0.0, 10015, 2, "2024/03/15 15:00:00", "いらっしゃいませ～♪\nきゃらばんこいん？を\n交換できるんだってー", 0.0, -470.0, "ナーナ");
INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (2, 4, 1, "2024/06/22 14:59:59", 2002, 130401, 3.35, 10016, 2, "2024/03/15 15:00:00", "甘いのくれたら、\nお礼にナーナの拾った\n松ぼっくりあげちゃうよ！", 0.0, -470.0, "ナーナ");
INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (1, 5, 1, "2024/09/22 14:59:59", 2002, 130502, 0.0, 10017, 1, "2024/06/15 15:00:00", "ショップへようこそ\nこの鳳凰が、皆さんに\n祝福を差し上げましょう", 0.0, -470.0, "ホウオウ");
INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (2, 5, 1, "2024/09/22 14:59:59", 2002, 130502, 3.18, 10018, 2, "2024/06/15 15:00:00", "ほーちゃんと呼ぶ権利は\n売っていませんよ？\n騎士さんへの、特別です！", 0.0, -470.0, "ホウオウ");
INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (3, 5, 4, "2024/09/22 14:59:59", 2002, 130503, 0.0, 10019, 4, "2024/06/15 15:00:00", "うﾞぇぇえんっ！まﾞだごの\n格好になっぢゃいまじだ！\n寄付をお願いじまず～っ！", 0.0, -470.0, "ホウオウ");
INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (1, 5, 2, "2024/09/22 14:59:59", 2002, 123301, 4.9, 10020, 1, "2024/06/15 15:00:00", "おっすー♪\nなんでも交換してけー\nカリザきゅん以外で", 0.0, -470.0, "ネア");
INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (2, 5, 2, "2024/09/22 14:59:59", 2002, 123301, 4.8, 10021, 1, "2024/06/15 15:00:00", "ところで、騎士きゅんは\nおいくら万ルピ？\nジョーダンぬ・き・で♡", 0.0, -470.0, "ネア");
INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (1, 6, 1, "2024/12/22 14:59:59", 2002, 133301, 4.922, 10022, 3, "2024/09/15 15:00:00", "ケッ、なんでオレ様が店番\nなんざ…って来んなキイロ\nオレは売りモンじゃねー！", 0.0, -470.0, "カリザ");
INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (2, 6, 5, "2024/12/22 14:59:59", 2002, 133301, 9.638, 10023, 3, "2024/09/15 15:00:00", "い、言わなきゃダメか？\n「…いらっしゃいませ…」\nクソッ、笑うんじゃねー！", 0.0, -470.0, "カリザ");
INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (1, 6, 2, "2024/12/22 14:59:59", 2002, 133401, 2.88, 10024, 1, "2024/09/15 15:00:00", "ショップへようこそ～\nネラさまの腹心…的な私が\n店番させていただきま～す", 0.0, -470.0, "ミーア");
INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (2, 6, 1, "2024/12/22 14:59:59", 2002, 133401, 4.818, 10025, 5, "2024/09/15 15:00:00", "私の抜け殻とか、\n需要ありますかね～…\nって冗談ですよ、冗談！", 0.0, -470.0, "ミーア");
INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (1, 7, 1, "2025/03/22 14:59:59", 2002, 133002, 1.78, 10026, 2, "2024/12/15 15:00:00", "へい、らっしゃい\nさ、騎士氏。冥土の土産は\nなにがいいですか？", 0.0, -470.0, "グレイス");
INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (2, 7, 7, "2025/03/22 14:59:59", 2002, 133002, 6.15, 10027, 1, "2024/12/15 15:00:00", "商品をお買い上げ毎に\nグレイスちゃんポイントを\n差し上げます。嘘ですが", 0.0, -470.0, "グレイス");
INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (1, 7, 2, "2025/03/22 14:59:59", 2002, 133102, 4.28, 10028, 6, "2024/12/15 15:00:00", "ようこそいらっしゃいませ\n…接客とは、このような\n振舞で宜しいでしょうか？", 0.0, -470.0, "ヴァイオレット");
INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (2, 7, 1, "2025/03/22 14:59:59", 2002, 133102, 0.0, 10029, 1, "2024/12/15 15:00:00", "じめじめした商品は\nございませんので\n安心してお買い求め下さい", 0.0, -470.0, "ヴァイオレット");
INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (1, 8, 1, "2025/06/23 14:59:59", 2002, 136902, 5.53, 10030, 2, "2025/03/15 15:00:00", "いらっしゃいましぇでしゅ\n何をお求めでしゅか？\nたこ焼きもありましゅよ！", 0.0, -470.0, "ルルィ");
INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (2, 8, 7, "2025/06/23 14:59:59", 2002, 136902, 6.05, 10031, 9, "2025/03/15 15:00:00", "そのコイン…ピカピカで、\n集めたくなっちゃいましゅ\nタコ釣られされちゃう～…", 0.0, -470.0, "ルルィ");
INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (1, 8, 1, "2025/06/23 14:59:59", 2002, 137001, 0.0, 10032, 2, "2025/03/15 15:00:00", "姫のご友人ならば\n礼儀を尽くすのが爺の務め\nさ、望みの物を言いたまえ", 0.0, -470.0, "デュラン");
INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (2, 8, 1, "2025/06/23 14:59:59", 2002, 137001, 0.0, 10033, 2, "2025/03/15 15:00:00", "キャラバンコインではなく\n首で支払って貰えんかのぅ\n…冗談であるぞ？", 0.0, -470.0, "デュラン");
INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (1, 9, 2, "2025/09/23 14:59:59", 2002, 135902, 0.0, 10034, 2, "2025/06/16 15:00:00", "おう\n好きなもん持ってきな", 0.0, -470.0, "サツキ");
INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (2, 9, 6, "2025/09/23 14:59:59", 2002, 135902, 4.935, 10035, 1, "2025/06/16 15:00:00", "宵越しの銭を持つような\n野暮いマネぁしくさんな\nツキが落ちてもしらねぇぜ", 0.0, -470.0, "サツキ");
INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (1, 9, 5, "2025/09/23 14:59:59", 2002, 135802, 7.441, 10036, 2, "2025/06/16 15:00:00", "ら、ら、らっしゃっせ…\nなんかほしいもん、ある？\nか、かき氷とか、ど…？", 0.0, -470.0, "ユキノ");
INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (2, 9, 7, "2025/09/23 14:59:59", 2002, 135802, 0.0, 10037, 7, "2025/06/16 15:00:00", "そ、そんな見ねぇで…\nあては、売りもんじゃ\nねぇよ…？", 0.0, -470.0, "ユキノ");
INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (1, 10, 2, "2025/12/22 14:59:59", 2002, 130901, 2.295, 10038, 2, "2025/09/16 15:00:00", "クルルをお求めですかっ？\nそれならお礼に、こちらの\n宝石もどうぞですよ～♪", 0.0, -470.0, "クルル");
INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (2, 10, 6, "2025/12/22 14:59:59", 2002, 130901, 6.281, 10039, 1, "2025/09/16 15:00:00", "はっ！　ヒーローさんから\nお代なんて頂けないです！\nどうぞどうぞ…え、ダメ？", 0.0, -470.0, "クルル");
INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (1, 10, 1, "2025/12/22 14:59:59", 2002, 137701, 5.549, 10040, 2, "2025/09/16 15:00:00", "よぅ！　今日の俺さまは\n門番じゃなく、店番だぜ\nメモピ～スフィア～てな！", 0.0, -470.0, "ヴォルガーノ");
INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (2, 10, 6, "2025/12/22 14:59:59", 2002, 137701, 2.64, 10041, 3, "2025/09/16 15:00:00", "…リマさんのブロマイド？\n買い取るに決まってらぁ！\nなんでも持ってけ泥棒っ！", 0.0, -470.0, "ヴォルガーノ");
INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (1, 11, 4, "2026/03/23 11:59:59", 2002, 132801, 7.642, 10042, 7, "2025/12/15 15:00:00", "こ、この格好は…ヴルムが\n集客効果があると言って…\n…本当でしょうか？", 0.0, -470.0, "ライラエル");
INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (2, 11, 1, "2026/03/23 11:59:59", 2002, 132802, 0.0, 10043, 1, "2025/12/15 15:00:00", "この我に店番させるとは…\n全て買わねば許さぬぞ\n我が国庫に貢献するが良い", 0.0, -470.0, "ライラエル");
INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (1, 11, 1, "2026/03/23 11:59:59", 2002, 134502, 0.0, 10044, 1, "2025/12/15 15:00:00", "アナライズっ！\n本日のオススメ商品は～…\nこちらですっ♪", 0.0, -470.0, "クローチェ");
INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (2, 11, 1, "2026/03/23 11:59:59", 2002, 134501, 3.72, 10045, 2, "2025/12/15 15:00:00", "ギガンティックローチェ、\nおひとついかがですかっ？\n格納庫用意して下さいねっ", 0.0, -470.0, "クローチェ");
